const e=JSON.parse('{"key":"v-f3655406","path":"/learning-notes/java/%E6%9E%9A%E4%B8%BE%E5%92%8C%E6%B3%A8%E8%A7%A3/%E8%87%AA%E5%AE%9A%E4%B9%89%E7%B1%BB%E5%AE%9E%E7%8E%B0%E6%9E%9A%E4%B8%BE.html","title":"自定义类实现枚举","lang":"zh-CN","frontmatter":{"order":1,"description":"自定义类实现枚举 枚举的引出 要求：创建季节(Season)对象，请设计并完成 季节是只有四个固定值（春、夏、秋、冬），不能修改，所以需要使用枚举 介绍 枚举对应英文(enumeration,简写 enum) 枚举是一组常量的集合。 可以这样理解：枚举属于一种特殊的类，里面只包含一组有限的特定的对象。 实现自定义枚举 实现步骤 将构造器私有化，防止直接 new 去掉 set 相关的方法 防止属性被修改 在 EnumerationSon 内部 直接创建固定的对象 固定的四个对象优化 可以加 final 对外暴露对象(通过为对象添加 public final static 修饰符) 可以提供 get 方法，但是不要提供 set","head":[["meta",{"property":"og:url","content":"https://mister-hope.github.io/spoony-z/learning-notes/java/%E6%9E%9A%E4%B8%BE%E5%92%8C%E6%B3%A8%E8%A7%A3/%E8%87%AA%E5%AE%9A%E4%B9%89%E7%B1%BB%E5%AE%9E%E7%8E%B0%E6%9E%9A%E4%B8%BE.html"}],["meta",{"property":"og:site_name","content":"SOBER"}],["meta",{"property":"og:title","content":"自定义类实现枚举"}],["meta",{"property":"og:description","content":"自定义类实现枚举 枚举的引出 要求：创建季节(Season)对象，请设计并完成 季节是只有四个固定值（春、夏、秋、冬），不能修改，所以需要使用枚举 介绍 枚举对应英文(enumeration,简写 enum) 枚举是一组常量的集合。 可以这样理解：枚举属于一种特殊的类，里面只包含一组有限的特定的对象。 实现自定义枚举 实现步骤 将构造器私有化，防止直接 new 去掉 set 相关的方法 防止属性被修改 在 EnumerationSon 内部 直接创建固定的对象 固定的四个对象优化 可以加 final 对外暴露对象(通过为对象添加 public final static 修饰符) 可以提供 get 方法，但是不要提供 set"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:locale","content":"zh-CN"}],["meta",{"property":"og:updated_time","content":"2023-06-13T01:10:56.000Z"}],["meta",{"property":"article:author","content":"SOBER"}],["meta",{"property":"article:modified_time","content":"2023-06-13T01:10:56.000Z"}],["script",{"type":"application/ld+json"},"{\\"@context\\":\\"https://schema.org\\",\\"@type\\":\\"Article\\",\\"headline\\":\\"自定义类实现枚举\\",\\"image\\":[\\"\\"],\\"dateModified\\":\\"2023-06-13T01:10:56.000Z\\",\\"author\\":[{\\"@type\\":\\"Person\\",\\"name\\":\\"SOBER\\",\\"url\\":\\"https://github.com/spoony-Z\\"}]}"]]},"headers":[{"level":2,"title":"枚举的引出","slug":"枚举的引出","link":"#枚举的引出","children":[]},{"level":2,"title":"介绍","slug":"介绍","link":"#介绍","children":[]},{"level":2,"title":"实现自定义枚举","slug":"实现自定义枚举","link":"#实现自定义枚举","children":[]}],"git":{"createdTime":1686418292000,"updatedTime":1686618656000,"contributors":[{"name":"杨胜军","email":"shenjun_y@yeah.net","commits":3}]},"readingTime":{"minutes":1.11,"words":333},"filePathRelative":"learning-notes/java/枚举和注解/自定义类实现枚举.md","localizedDate":"2023年6月11日","excerpt":"<h1> 自定义类实现枚举</h1>\\n<h2> 枚举的引出</h2>\\n<blockquote>\\n<p>要求：创建季节(Season)对象，请设计并完成\\n季节是只有四个固定值（春、夏、秋、冬），不能修改，所以需要使用枚举</p>\\n</blockquote>\\n<h2> 介绍</h2>\\n<ol>\\n<li>枚举对应英文(enumeration,简写 enum)</li>\\n<li>枚举是一组常量的集合。</li>\\n<li>可以这样理解：枚举属于一种特殊的类，里面只包含一组有限的特定的对象。</li>\\n</ol>\\n<h2> 实现自定义枚举</h2>\\n<ul>\\n<li>实现步骤</li>\\n</ul>\\n<ol>\\n<li>将构造器私有化，防止直接 new</li>\\n<li>去掉 set 相关的方法 防止属性被修改</li>\\n<li>在 EnumerationSon 内部 直接创建固定的对象</li>\\n<li>固定的四个对象优化 可以加 final</li>\\n<li>对外暴露对象(通过为对象添加 <strong>public final static</strong> 修饰符)</li>\\n<li>可以提供 <strong>get</strong> 方法，但是不要提供 <strong>set</strong></li>\\n</ol>","autoDesc":true}');export{e as data};
